svg.script:
  document.addEventListener("DOMContentLoaded", animate);
  function animate(e) {
   var w1l = document.getElementById('w1').getElementsByTagName( 'line' )[0];
   var w2l = document.getElementById('w2').getElementsByTagName( 'line' )[0];
   var w3l = document.getElementById('w3').getElementsByTagName( 'line' )[0];
   var w1a = document.getElementById('w1').getElementsByTagName( 'polyline' )[0];
   var w2a = document.getElementById('w2').getElementsByTagName( 'polyline' )[0];
   var w3a = document.getElementById('w3').getElementsByTagName( 'polyline' )[0];
   var w1d = document.getElementById('w1d');
   var w2d = document.getElementById('w2d');
   var w3d = document.getElementById('w3d');
   var wc=new Array(3);
   wc[1] = document.getElementById('w1c');
   wc[2] = document.getElementById('w2c');
   wc[3] = document.getElementById('w3c');
   var l = 8000; var t = 16; var s = l; var x = 0; var y = 0; var z = 0;

   setInterval(function () {
     if(window.getComputedStyle(wc[1]).getPropertyValue('animation-play-state')=='paused'){return true}
	 if(s >= l){
		s=0
		wc[1].style['display'] = 'none'; wc[2].style['display'] = 'none'; wc[3].style['display'] = 'none';
		x=0; y=0; z=0;
	}
	 else if(s>=l/8&&x==0){
		x=Math.floor(Math.random()*3)+1;
		wc[x].style['display'] = 'inline';
	}
	 else if(s>=2*l/8&&y==0){
		y=(x+Math.round(Math.random()))%3+1;
		wc[y].style['display'] = 'inline';
	}
	 else if(s>=3*l/8&&z==0){
		z=x^y;
		wc[z].style['display'] = 'inline';
	}

	if(s>=l/8&&s<=3*l/16){
		wc[x].style['opacity'] = Math.min(1,(s/l-1/8)*16);
	}
	else if(s>=2*l/8&&s<=5*l/16){
		wc[y].style['opacity'] = Math.min(1,(s/l-2/8)*16);
	}
	else if(s>=3*l/8&&s<=7*l/16) {
		wc[z].style['opacity'] = Math.min(1,(s/l-3/8)*16);
	}
	 s=s+t;
    }, t)
}
